INSERT INTO `tblhhitestimonial` (`intID`, `varPatientName`, `varPatientNameHindi`, `varFeedbackDate`, `varFeedback`, `varFeedBackHindi`, `varStatus`, `varPhoto`) VALUES
(1, ' Mrs. R. Jain  ', ' Mrs. R. Jain  ', '22-12-2015', 'I was having above average body weight due to which I had breathlessness, lethargy and heaviness all over body.\r\nI was unable to walk fast. My blood cholesterols and triglyceride levels were much on higher side. One of our family friends suggested me to take “Holistic Medicines” So I consulted Dr. R. K. Chaudhari and started his medicines, Now after only 1 and a half months medicines, I am feeling much better, my heaviness is all gone, I am doing all my routine works with great enthusiasm without feeling breathlessness, everybody around me keep working me about this change they notice and also compliment me for this positive change in my general health. I am regularly taking “Dr. R. K. Chaudhari’s Holistic Medicines” and will not stop till complete cure. I will also recommend my friends and relatives to consult Dr. R. K. Chaudhari Sir.', '', 'OK', 'NoProfile.jpg'),
(2, 'Mr. Shamim sheikh ', 'Mr. Shamim sheikh ', '22-12-2015', 'I was suffering from serve chromic cough and cold. Since 4-5 years. I had taken many drugs – Allopathic, Ayurvedic and Homeopathic also. I was told that, I was allergic to dust, cold weather and some food articles. I was given too many medicines and I was told to avoid cold weather, cold water, ice creams, and cold drinks and lot more things, which was very difficult for me but still I strictly followed their advice, but results were not so good.\r\nI also visited number of ENT surgeons, some of them advice surgery of “D.N.S." homeopathic treatment. One of my aunt told me to visit “Holistic Clinic” So I consulted Dr. R. K. Chaudhari Sir he assured me and gave his medicines And I was Surprised... I could eat ice cream, cold drinks, everything, cold &amp; cough was all gone. This was much better than all my previous treatment. Thanks to Dr. R. K. Chaudhari Sir and his entire team.', '', 'OK', 'NoProfile.jpg'),
(3, 'Mr. & Mrs. Anjali', 'Mr. & Mrs. Anjali', '22-12-2015', 'We have being treated by various experts for over 4-5 years but we had not achieved success.  We are married from 6and half years and not having a child. After much treatment at different hospitals. We were told about “Dr. R. K. Chaudhari’s Holistic Health” centre. I was having low sperm count( Oligospermia) and my wife was also having maternal irregularities and polycystic ovaries we both received treatments under “ Dr. R. K. Chaudhari’s Holistic Health” centre  from 3 months and one five day we got that far awaited news , my wife got her pregnancy test positive. We now take his opinion in each and every health problem that comes to our family and relatives', '', 'OK', 'NoProfile.jpg'),
(4, 'Mr. Chittalwala ', '', '22-12-2015', 'I was having several health problems due to my exercise, work tensions, heavy workloads, lac of exercise, and lot of spicy and oily foods.  My weight was increasing continually which created many metabolic problems for me like Diabetes, High B.P., and Cholesterol. I had to undergo Angiography which revealed the blockages in my arteries. I was on Allopathic medicines for these problems, but still not feeling well, I mean not comfortable, breathlessness, heaviness was these. One of my friends told me about “Dr. R. K. Choudhari Holistic Health Centre”. When I met Doctor he carefully examined me and advised his medicines. I am now taking his medicines with my routine   allopathic medicines and I am much better now Breathlessness and Heaviness is not there at all in fact I feel younger than my age now. Thanks to Dr. R. K. Choudhari Sir and his holistic Medicines.', '', 'OK', '1'),
(6, '', 'हृषिकेश  बाविस्कर', '22-12-2015', '', 'वायरल  वॉटस (मस्से ) गिर  गये। \nमुझे  मेरे दाहिने  हाथ  पर  कलाई  के आस पास  ४ -५  वायरल  वॉटस निकल आये  थे  जो  दिखने  में काफी  ख़राब  लगता  था और हर कोई उसी  के बारे में  मुझसे  पूछ लेता था  इस  कारन में बहुत परेशान हो गया था।  मैंने  बहुत जगह इसका इलाज किया लेकिन कुछ फायदा  नजर नहीं आया।  अयः तक की चमड़ी रोग विशेषज्ञ  (स्किन स्पेशलिस्ट)  की दवा ली। फिर भी मस्से  जैसे  के  वेसे  बने  रहे. एक दो बार स्किन स्पेशलिस्ट  ने लेसर की सहायता  से १ -२ मस्से जलाकर  निकाल  भी दिए पर कुछ ही दिन में वो फिर से निकल आये। तभी मुझे डॉ. आर. के. चौधरीज होलिस्टिक हेल्थ के बार में  पता  चला।  में  डॉ.  चौधरी सर से मिला और उनकी दवा शुरू  करते ही असर शुरू  हो गया।  केवल डेढ  महीने  मात्र  की दवा ने  सारे मस्से  जड़  से निकल  कर गिर गए  और  हाथ  पूर्ववत  हो गया।  बहुत ही कम  समय और खर्चे  में मेरा यह इलाज यशस्वी हो गया।  अब में और मेरा सभी  परिवार डॉ. आर. के. चौधरीज होलिस्टिक औषधी का  ही प्रयोग हमेशा करते है।   \n', 'OK', '1AuRb7ilypVujjwQWSrtWJcB83jJLgsG495CtWN4n9cKe.jpg'),
(7, '', 'जॅकी शेख ', '22-12-2015', '', 'बॉडी बिल्डिंग में सुधर हुआ।\r\nमें  काफी  मेहनत से प्रोफेशनल  बॉडी बिल्डिंग की तैयारी की तैयारी कर रहा था।  उचित खान पान ,डाएट तथा रेगुलर वर्क आउट से  मेरे मसल्स  की साइज़  और पावर बढ़ रही थी  मगर मुझे  जैसा चाहिए वैसा  परिणाम दिखाई  नहीं दे रहा था।  तभी डॉ. आर. के.  चौधरी सर   ने मेरे और मेरे पुरे परिवार के पुराने चिकिस्तक  और मित्र रहे है ,उन्होंने मेरे मुझे उनके होलिस्टिक कॉम्बिनेशन ९ (बॉडी बिल्डिंग , वेट् गेन , जनरल हेल्थ )  लेने की सलाह दी। \r\nइन दवाईयों का  असर होते ही मेरा पाचनतंत्र काफी सुधर हुवा। वर्क आउट का स्टैमिना बड़  गया ,जिसके परिणाम स्वरुप मेरे मसल्स साइज में ग्रोथ  आने लगी और  बहोत ही जल्द प्रोफेशनल बॉडी बिल्डिंग कॉम्पिटेशन्स  में हिस्सा लेने लगा और मुझे कई  मेडल्स और सभी की प्रशंसा प्राप्त  हुई।  अब में मेरे सभी मित्रों एवं सम्बन्धियों को डॉ. साहब की औषधी लेने की ही सलाह देता हुँ।\r\n', 'OK', '1AhUCfSP2sqK3aRjgroridFGtmca_sI1ycyaLcIJ-IRcp.jpg'),
(8, '', 'मिसेस आर जैन ', '22-12-2015', '', 'मोटापा - कोलेस्टेरोल , बी.  पि.  कम  हुआ। \r\nमुझे कई सालों से ज्यादा वजन के कारण  साँस  फूलना ,घुटनो का दर्द, पीठ दर्द , ब्लड प्रेशर बढ़ाना  इत्यादि तकलीफे हो रही थी।  वजन की वजह से मेरा कोलेस्टेरोल भी बढ़  रहा था। मुझे मेरे पडोसीयों  ने डॉ  आर के चौधरीज  हॉलिस्टिक हेल्थ के बारे में बताया।तब मैंने डॉ  साहब से मुलाकात की और उन्होंने  मेरी सारी  जाँच रिपोर्ट बतायी और मेरी तकलीफो के बारे में बताया। डॉ साहब ने मेरी दवाइयाँ  बनाकर शुरू कर दी। मुझे कुछ ही दिनों में बेहतर  लगने लगा।  वजन की वजह से होने वाली थकान  कम हो गयी।  मुझे सभी मेरे सेहत में आये बदलाव के बारे में पूछते लगे।  ३ महीने के अंतराल के बाद मेरा कोलेस्टेरोल लेवल भी नॉर्मल  आ गया।  अब मे  और मेरे सभी परिवार के सदस्य  और मित्र डॉ. साहब की औषधीयाँ ही इस्तेमाल करते है। ', 'OK', 'NoProfile.jpg'),
(9, '', 'श्री  विट्ठल ब्राह्मणे ', '22-12-2015', '', 'किडनी स्टोन (पथरी ) निकल गया। \r\nमें  विट्ठल ब्राह्मणे  डॉ  आर  के चौधरी सर का  कई सालों  से पेशंट रहा हु।  मुझे अभी हाल ही में बहोत जोरो से पेट दर्द ,उल्टियाँ ,पेशाब में तकलीफ  इत्यादि  शिकायते होने लगी।  में तुरंत डॉक्टर साहब के पास आया , तभी सोनोग्राफी में यह पता चला की मुझे किडनी स्टोन (पथरी ) हो गया है। मुझे डॉक्टर साहब ने औषधियां दी और पेशाब पर ध्यान रखने की सलाह दी।  आचर्यजनक बात यह है  की  उनकी दवा की ३ -४ दिन की  खुराक के बाद ही मुझे मेरे पेशाब में  एक बड़ा सा स्टोन निकल आया। मैंने बहुत दिन बाद सकून  का एहसास  किया। मेरा पेट , पेशाब  की तकलीफ सबकुछ पूरी तरह बंद हो गया।   बहुत बहुत  धन्यवाद देता हुँ।  और आप सभी से प्रार्थना  करता हुँ ऐसी  सधी और सरीक दवावों  का आप भी प्रयोग करे और रोग मुक्त स्वास्थ का लाभ उठाये।', 'OK', '1ab027171-bcc6-4530-beed-19bca4098c43.jpg');
